import { Card } from 'react-bootstrap';

const Todo = (props) => {
    const {id,title,desc}=props.todo;
  return (
    <div>
        <Card>
      <div className="mb-2 text-muted">
        <h3>{title}</h3>
        <p>{desc}</p>
      </div>
    </Card>
    </div>
    
  )
}

export default Todo
